      author: "mario",
      id: 3,
    },
  ]);

  return (
    <div className='home'>
      <h2>Homepage</h2>
      {/* <p>
        {" "}
        {name} is {age}{" "}
      </p>
      <button onClick={handleClick}>Click me</button> */}

      {blogs.map((blog) => (
        <div className='blog-preview' key={blog.id}></div>
      ))}
    </div>
  );
};

export default Home;
